    const emulError = () => {
        throw new Error('Что-то сломалося')
    }
    return (
        <ErrorBoundary>
            <div>
                <Spinner/>
                <button onClick={emulError}>error</button>
            </div>
        </ErrorBoundary>

    );
};

export default App;
